.
You will need:
3 Earl Grey teabags brewed in 100ml boiling water
150g Mixed dried fruit
200ml Soya milk
1 tbsp Cider vineger
75g Caster sugar
150g Butter
100g Ground almonds
200g Plain flour
1 tsp Bicarbonate of soda
100g Grated carrot
Zest of Â½ a lemon
50g Chopped pistachios
.
Start by adding the vinegar to the milk and setting aside to thicken. Add the dried fruit to the boiling water with the teabags. 
.
Beat the butter and sugar together then add in the milk mixture. Fold in the flour, almonds, bicarb and lemon zest until you have a smooth batter. 
.
Fold through the grated carrot, pistachios and dried fruit with the tea liquid. Pour into a lined tray and bake for 30mins @ 180c. 
.
I topped mine with @tynechease original cream chease mixed with a little icing sugar and some more pistachios. 
